import { Table, Layout, Space, Row, Col} from "antd";
import "./App.less";
import React from "react";

const { Header, Footer, Sider, Content } = Layout;

function App() {

  return (
    <div className="App">     
    <Layout style={{}}>
      <Space>
      <Sider width="200" style={{background: 'orange'}}>
        <Layout>
          <Row style={{background: 'orange'}}>카운터자리(원)</Row>
          <Row style={{background: 'orange'}}>구단명자리(테이블)</Row>
        </Layout>
      </Sider>
      <Layout>
        <Space direction="vertical">
        <Header style={{background: 'green'}}>현재선택선수자리</Header>
        <Content style={{width: '1200px'}}>선수명단자리(테이블)</Content>
        <Footer style={{background: 'black', color: 'white'}}>예비자리</Footer>
        </Space>
      </Layout>
      <Sider width="100" style={{background: 'orange'}}>선택된선수자리</Sider>
      </Space>
    </Layout>  
    </div>
  );
}
export default App;
